import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Redirect,
} from "react-router-dom";

import Home from './app/Home/Home';
import LandingPage from './app/Login/LandingPage';

function App(props) {
    
    const auth_token = localStorage.getItem('authtoken');
    const userData = localStorage.getItem('userData');

    
    return (
        <>
            {/* <LoadingBar style={{ background: "#E5017D", zIndex: 99, position: "fixed"}} /> */}
            <Router>
                <Switch>
                        <Route path="/">
                            {auth_token === null || userData === null && <Redirect to="/home/pages" />}
                            <LandingPage />
                        </Route>

                        <Route path="/home">
                            {auth_token && userData && <Home />}
                            {/* <Home /> */}
                        </Route>
                    
                    {/* <Route path="/dachboard">
                        {
                            localStorage.getItem("authtoken") ?
                                <Dachboard />
                                :
                                <Redirect to="/" />

                        }
                    </Route>


                    <Route path="/">
                        {localStorage.getItem("authtoken") ?
                            <Redirect to="/dachboard" />
                            :
                            <LandingPage />
                        }
                    </Route> */}

                </Switch>
            </Router>
        </>
    )
}

export default App;
